import Link from 'next/link'
export default  ( ) => <body style={{
    backgroundImage: 'url("https://earthsky.org/upl/2011/05/peregrine-falcon-diving-800.jpg")',
    backgroundRepeat: "no-repeat",
    backgroundAttachment: "fixed",
    backgroundPosition: "center",
}}>
    <h1 style={{
        color: 'orangered'
    }}>World's Fastest Animal Dot Com</h1>
    <h2 style={{
            color: 'red'
        }} >Facts</h2>
    <ul
        style={{
            color: 'red'
        }} 
    >
        <li>Zebras can go 40 miles per hour</li>
        <li>Cheetas can go 72 miles per hour</li>
        <li>Peregrin falcons can go 200 or 250 or somewhere between</li>
    </ul>
    <footer>
        <Link href="about-the-author" >About the Author</Link>
    </footer>
</body>
